import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './pages/Home';           // Importando a página Home
import About from './pages/About';         // Importando a página About
import Settings from './pages/Settings';   // Importando a página Settings
import Sidenav from './components/Sidenav'; // Importe o componente Sidenav
import CriarTurmaPage from './components/CriarTurma'; // Página Criar Turma
import Form from './components/Form';      // Importando o Form
import Form2 from './components/Form2';    // Importando o Form2

function App() {
  return (
    <Router>
      <Routes>
        {/* Definindo várias rotas para diferentes componentes */}
        <Route path="/" element={<Form2 />} />               {/* Página principal */}
        <Route path="/sidenav" element={<Sidenav />} />      {/* Página com sidenav */}
        <Route path="/home" element={<Home />} />            {/* Página Home */}
        <Route path="/about" element={<About />} />          {/* Página About */}
        <Route path="/settings" element={<Settings />} />    {/* Página Settings */}
        <Route path="/criar-turma" element={<CriarTurmaPage />} /> {/* Página Criar Turma */}
        <Route path="/form" element={<Form />} />            {/* Página Form */}
      </Routes>
    </Router>
  );
}

export default App;
